[AuthScaffold
	  |
	  +body: Widget;
	  +formKey: AuthFormKey;
	  +leftContentMinWidth: double;
	  +leftPanelMinWidth: double;
	  +leftPanelPadding: EdgeInsets
	]

	[AuthScaffold]o-[<abstract>Widget]
	[AuthScaffold]o-[AuthFormKey]
	[AuthScaffold]o-[EdgeInsets]

	[SignupForm
	  |
	  +formKey: AuthFormKey
	  |
	  +Widget build();
	  -dynamic _onClickTermsOfUse();
	  -dynamic _onClickPrivacyPolicy()
	]

	[SignupForm]o-[AuthFormKey]
	[<abstract>FormConsumerRefWidget]<:-[SignupForm]

	[PasswordRecoveryForm
	  |
	  +formKey: AuthFormKey
	  |
	  +Widget build()
	]

	[PasswordRecoveryForm]o-[AuthFormKey]
	[<abstract>FormConsumerRefWidget]<:-[PasswordRecoveryForm]

	[PasswordForgotForm
	  |
	  +formKey: AuthFormKey
	  |
	  +Widget build()
	]

	[PasswordForgotForm]o-[AuthFormKey]
	[<abstract>FormConsumerRefWidget]<:-[PasswordForgotForm]

	[AuthFormController
	  |
	  +authRepository: IAuthRepository;
	  +sharedPreferences: SharedPreferences;
	  +notificationService: INotificationService;
	  +router: GoRouter;
	  +emailControl: FormControl<String>;
	  +passwordControl: FormControl<String>;
	  +passwordConfirmationControl: FormControl<String>;
	  +rememberMeControl: FormControl<bool>;
	  +termsOfServiceControl: FormControl<bool>;
	  <static>+authValidationMessages: Map<String, String Function(dynamic)>;
	  +loginForm: FormGroup;
	  +signupForm: FormGroup;
	  +passwordForgotForm: FormGroup;
	  +passwordRecoveryForm: FormGroup;
	  +controlValidatorsByForm: Map<AuthFormKey, Map<FormControl<dynamic>, List<Validator<dynamic>>>>;
	  -_formKey: AuthFormKey;
	  +shouldRemember: bool;
	  +formKey: AuthFormKey;
	  +form: FormGroup
	  |
	  -dynamic _onChangeFormKey();
	  +dynamic resetControlsFor();
	  -dynamic _forceValidationMessages();
	  +dynamic signUp();
	  -dynamic _signUp();
	  +dynamic signIn();
	  -dynamic _signInWith();
	  +dynamic signOut();
	  +dynamic resetPasswordForEmail();
	  +dynamic sendPasswordResetLink();
	  +dynamic recoverPassword();
	  +dynamic updateUser();
	  -void _setRememberMe();
	  -void _delRememberMe();
	  -void _initRememberMe()
	]

	[AuthFormController]o-[<abstract>IAuthRepository]
	[AuthFormController]o-[SharedPreferences]
	[AuthFormController]o-[<abstract>INotificationService]
	[AuthFormController]o-[GoRouter]
	[AuthFormController]o-[FormControl]
	[AuthFormController]o-[FormGroup]
	[AuthFormController]o-[AuthFormKey]
	[<abstract>IFormGroupController]<:--[AuthFormController]

	[AuthFormKey
	  |
	  +index: int;
	  <static>+values: List<AuthFormKey>;
	  <static>+login: AuthFormKey;
	  <static>+signup: AuthFormKey;
	  <static>+passwordForgot: AuthFormKey;
	  <static>+passwordRecovery: AuthFormKey;
	  <static>-_loginSubmit: AuthFormKey;
	  <static>-_signupSubmit: AuthFormKey
	]

	[AuthFormKey]o-[AuthFormKey]
	[Enum]<:--[AuthFormKey]

	[EmailTextField
	  |
	  +labelText: String;
	  +hintText: String?;
	  +formControlName: String?;
	  +formControl: FormControl<dynamic>?
	]

	[EmailTextField]o-[FormControl]

	[PasswordTextField
	  |
	  +labelText: String;
	  +hintText: String?;
	  +formControlName: String?;
	  +formControl: FormControl<dynamic>?
	]

	[PasswordTextField]o-[FormControl]

	[StudyUJobsToBeDone
	  |
	  +Widget build()
	]

	[LoginForm
	  |
	  +formKey: AuthFormKey
	  |
	  +Widget build()
	]

	[LoginForm]o-[AuthFormKey]
	[<abstract>FormConsumerRefWidget]<:-[LoginForm]
